import React, { Component } from 'react';
import { Link } from 'react-router-dom'

class Nav extends Component {
  render() {
    return (
      <nav className="navbar">
        <ul>
          <li><Link to='/'>Hourly details</Link></li>
          <li><Link to='/charts'>Charts</Link></li>
        </ul>
      </nav>
    );
  }
}

export default Nav;
